import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../css/header.css"

class Header extends Component {
    render() {
        return (
            <nav class="navbar navbar-light bg-light navstyle">
                <ul className="nav navbar-nav navbar-left">
                    <li>
                        <a class="navbar-brand" href="#">
                            <img src={require("../img/logo.png")} width="30" height="30" class="d-inline-block align-top" alt="" />
                        </a>
                    </li>
                </ul>
                <div className="navbar-brand">
                    U4Ea Web Player
                </div>
                <ul className="nav navbar-nav navbar-right">
                    <li>
                        <a href="https://itunes.apple.com/us/app/u4ea/id1276634916?mt=8">
                            <button type="button" class="btn btn-success btn-rounded">Download for iOS</button>
                        </a>
                    </li>
                </ul>
            </nav>

        )
    }
}

export default Header;
